import React from "react";
// TODO: import useFormik from formik library
import {useFormik} from 'formik'

function App() {
  // TODO: add a const called formik assigned to useFormik()
  const formik = useFormik({
    initialValues: {
      email: '',
      password: ''
    },
    onSubmit: values => { 
      alert('Login Successful') 
    },
    validate: values => {
      let errors = {};
      if(!values.email) errors.email = 'Required Field';
      if(!values.password) errors.password = 'Required Field';
      return errors;
    }
  });

  return (
    <div>
    <form onSubmit={formik.handleSubmit}>
      <div>Email</div>
      <input id="emailField" type="text" onChange={formik.handleChange} value={formik.values.email}/>
      <div>Password</div>
      <input id="pswField" type="text" onChange={formik.handleChange} value={formik.values.password}/>
      <button id="submitBtn" type="submit">Submit</button>
    </form>
    </div>
  );
}

export default App;
